const PCOLORS=["#f77189","#bb9832","#50b131","#36ada4","#3ba3ec","#e866f4"];class Bar{constructor(t,e,l,o,n,a,c){this.id=t;this.name=e;this.x_label=l;this.y_label=o;this.labels=n;this.values=a;this.log_toggle=c}}class MultiBar{constructor(t,e,l,o,n,a,c){this.id=t;this.names=e;this.x_label=l;this.y_label=o;this.labels=n;this.values=a;this.log_toggle=c}}function buildPlotDownload(e,l,o){console.log("btn-download-plot-"+l);document.getElementById("btn-download-plot-"+l).onclick=function(){var t=document.createElement("a");t.href=e.toBase64Image();t.download=o+"_"+l+".png";t.click()}}function buildTableDownload(l,t,o){document.getElementById("btn-download-table-"+t).onclick=function(){let t=new Blob([l],{type:"text/plain"});var e=document.createElement("a");e.href=URL.createObjectURL(t);e.download=o+"_table.tsv";e.click()}}function buildLogToggle(e,t){document.getElementById("btn-logscale-plot-"+t).addEventListener("change",function(t){if(t.currentTarget.checked){e.options.scales.y.type="logarithmic"}else{e.options.scales.y.type="linear"}e.update()})}
